import React from "react";
import { Link } from "react-router-dom";

const GroupRoom = () => {
    return(
        <div className="single-room">
        <div className="overlay">
           <img className="room-image" src={`${process.env.PUBLIC_URL}/vivian-source/group2.jpg`} alt="Room" />
           <div className="text-overlay">Phòng Tập Thể</div>
       </div>

       <h1 className="thongtin">Thông Tin Phòng</h1><hr/>

       <div className="room-container">

       </div>


       <div className="room-img">
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group3.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group4.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group5.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group6.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group7.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group8.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/group9.jpg`} alt="Room" />
           <img src={`${process.env.PUBLIC_URL}/vivian-source/room2.jpg`} alt="Room" />

       </div>


   </div>

    );
};

export default GroupRoom;
